import React, {Component} from 'react';
import './style.css';

const header_background = {
    backgroundColor:'#77d0f2',
};

class Navbar extends Component {

    render() {
        return (
            <div className="pad20 hei200" style={header_background}>
                MENU
            </div>
        );
    }

}

export default Navbar;
